import React from 'react';
function Projects() {
    return (
<div>
    <center><h1>Project list</h1></center>
    <AddProject />
</div>
    );
}
function AddProject() {
    return (
<button align="right">Add new project</button>
    );
}
function ProjectList(){
    return(
<div>
    <h1>Project name</h1>
    <p>Languages: ...</p>
    <p>Last updated: ...</p>
</div>
    );
}
export default Projects;
